'use strict';
//@@DocInclude
//@@DocBrief("Defines constants for different statuses of orders in a trading system")
class OrderStatus {
    static get Waiting() { return "W"; }
    static get InProcess() { return "P"; }
    static get DealerIntervention() { return "I"; }
    static get Requoted() { return "Q"; }
    static get Executing() { return "E"; }
    static get Cancelled() { return "C"; }
    static get Rejected() { return "R"; }
    static get Expired() { return "T"; }
    static get Executed() { return "F"; }
    static get PendingCalculated() { return "U"; }
    static get PendingCancelled() { return "S"; }
    static get PendingCancelCalculated() { return "H"; }
}
module.exports = OrderStatus
